// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;


contract NFTProduct {
    int128 public ID;  
    string public Name ;
    uint256 public Price; 
    int128 public Num ; 
    address public CreateHash;
    address public UserHash ; 
    string public Topic ; 
    string public Description ;
    string public Ipfshash ;                
    int16 public Royalties ; 
    

    constructor(){
        CreateHash = msg.sender ;
    }

    
    // 發布NFT
    function DeployedNFT(string memory _name , uint256 _price , int128 _num , 
    string memory _topic , int16 _roy , string memory _des,string memory _ipfs ,string memory _hash )  public   
    {
        ID ++ ; 
        Name = _name; 
        CreateHash = msg.sender ; 
        Price = _price ; 
        Num = _num ;         
        Topic = _topic ;
        Royalties = _roy ;      
        Ipfshash = _ipfs ; 
        Description = _des ; 
        emit Success(ID,_name , msg.sender, _price ,_num, _topic , _roy ,_ipfs , _des ,_hash );
    }
    
    // 購買NFT
    function BuyNFT(address payable _creator, string memory _ipfs ,
         uint256 _price, int128 _id , string memory _hash ) payable  public {    
        payable(_creator).transfer(msg.value); // 向創作者轉帳
        emit BuySuccess(msg.sender,_creator , _ipfs , _price , _id , _hash );
    }

    // 轉賣NFT
    function ResellNFT(address payable from, address payable _creator , 
    int128 _nftid , uint128 _roy) payable public {   
        payable(from).transfer(msg.value / 100 * (100 - _roy )); // 向轉賣者轉帳
        payable(_creator).transfer(msg.value / 100 * _roy ) ; // 創作者抽成
        emit ResellSuccess(msg.sender,_creator ,from , msg.value ,_nftid , _roy );
    }
    // 轉賣NFT 事件
    event ResellSuccess(
        address user ,
        address creator,
        address from ,        
        uint256 _price,
        int128 _id ,
        uint _roy
    );
    
    // 成功購買事件
    event BuySuccess(
        address user,
        address creater,
        string _ipfs ,
        uint _price,
        int128 _id,
        string _hash 
    );
    // 發布成功事件
    event Success(
       int128 ID, 
       string Name,
       address CreateHash ,
       uint256 Price, 
       int128 Num ,       
       string Topic,
       int16 Royalties, 
       string IpfsHash,
       string Description,
       string Hash 
    );

}
